import { ICourse } from "../Interface/ICourse";
import "./wishlist.css";
const Mywishlist= (props: { data:ICourse[]}) => {



  return (
<div className="cart">
      <div className="cart-header ">Your Cart Detail </div>
       {props.data.map((value,key)=>{
       return (
        <div className="basiccontainer" key={value.id}>
          <div className="image">
          <label >{value.image}
            </label>
            <div  className="carttittle">
            {value.Tittle}
          </div>
          </div>

          <div className="cartprice">
          <label >RS{value.ActualPrice}/-</label>  
          </div>
        </div>
      );

      })} 
      <div>Total Price</div></div>
  )




};
export default Mywishlist;
